import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/HomePage.css';

function HomePage() {
    const quotes = [
        "Believe in yourself and all that you are.",
        "Your only limit is your mind.",
        "Every day is a fresh start.",
        "Dream big and dare to fail.",
        "Stay positive, work hard, make it happen."
    ];

    const randomQuote = quotes[Math.floor(Math.random() * quotes.length)];

    return (
        <div className="page-container">
            <header className="navbar">
                <h1 className="navbar-title">GROW IMPRESS</h1>
                <p className="navbar-subtitle">Your personal growth journey starts here.</p>
                <div className="navbar-links">
                    <Link to="/how-to-section" className="nav-link">HOW TO SECTION</Link>
                    <Link to="/stories" className="nav-link">STORIES OF INSPIRATION</Link>
                    <Link to="/resources" className="nav-link">RESOURCES</Link>
                    <Link to="/chatbot" className="nav-link">CHAT WITH US</Link>
                </div>
            </header>

            <div className="home-content main-content-wrapper">
                <img src="Gemini_Generated_Image_u0141pu0141pu014.jpeg" alt="rose" className="center-image" />
                <h2 className="quote">{randomQuote}</h2>
            </div>
        </div>
    );
}

export default HomePage;
